import Home from "./home";
import { Navbar } from "./Navbar";
import { Footer } from "./Footer";

const App = () => {
    return (
        <div className="hello">
            <header className="header">
                <Navbar />
            </header>
            <main>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/blogs" element={<BlogList />} />
                </Routes>
            </main>
            <footer>
                <Footer />
            </footer>
        </div>
    );
};

export default App;
